	(1, 3, '2018-09-10 20:36:09', '2018-09-10 20:36:09', 'Welcome to WordPress. This is your first post. Edit or delete it, then start writing!', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2018-09-10 20:36:09', '2018-09-10 20:36:09', '', 0, 'http://localhost/artumnal/?p=1', 0, 'post', '', 1),
	(6, 3, '2018-09-10 20:36:09', '2018-09-10 20:36:09', '<h2>Who we are</h2><p>Our website address is: http://localhost/artumnal.</p><h2>What personal data we collect and why we collect it</h2><h3>Comments</h3><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Media</h3><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><h3>Cookies</h3><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><h2>Who we share your data with</h2><h2>How long we retain your data</h2><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><h2>Additional information</h2><h3>How we protect your data</h3><h3>What data breach procedures we have in place</h3><h3>What third parties we receive data from</h3><h3>What automated decision making and/or profiling we do with user data</h3><h3>Industry regulatory disclosure requirements</h3>', 'Privacy Policy', '', 'draft', 'closed', 'open', '', 'privacy-policy', '', '', '2018-09-10 20:36:09', '2018-09-10 20:36:09', '', 0, 'http://localhost/artumnal/?page_id=3', 0, 'page', '', 0),
	(7, 3, '2018-09-10 20:39:27', '2018-09-10 20:39:27', '<div class="gmail_default"><span style="font-weight: 400;">Show your commitment to Burning Man arts as a <a href="https://www.eventbrite.com/e/artumnal-gathering-dinner-auction-tickets-62960325027" target="_blank" rel="noopener noreferrer">table sponsor</a> reserve your tickets by October 16th to be listed on event materials.</span></div>\r\n<div class="gmail_default"></div>\r\n<div class="gmail_default"></div>\r\n<div class="fancy-box">\r\n<h2>Library of Babel Dinner and Auction: Terra Gallery, 511 Harrison Street, San Francisco</h2>\r\nSaturday, November 16, 2019 | 5:00 PM\r\n\r\n<a href="https://www.eventbrite.com/e/artumnal-gathering-dinner-auction-tickets-62960325027" target="_blank" rel="noopener noreferrer">Reserved Table for eight guests Gala Dinner &amp; Auction  $5,000-$25,000</a>\r\n\r\n<a href="https://www.eventbrite.com/e/artumnal-gathering-dinner-auction-tickets-62960325027" target="_blank" rel="noopener noreferrer">Individual Ticket Gala Dinner &amp; Auction  $625</a>\r\n<h2>Artumnal Gathering Celebration: <span style="font-weight: 400;">Great Northern, 119 Utah Street, San Francisco</span></h2>\r\n<span style="font-weight: 400;">Friday, November 15, 2019 | 9:00pm-4:00am\r\n</span><span style="font-weight: 400;">Tickets: $40-$60 (available soon)\r\n</span><span style="font-weight: 400;">Presented by Pink Mammoth</span>\r\n\r\n</div>\r\n\r\n[caption id="attachment_200" align="aligncenter" width="565"]<img class="wp-image-200" src="http://artumnal.burningman.org/wp-content/uploads/2018-Artumnal_044-1-300x200.jpg" alt="" width="565" height="376" /> Photo by Chuck Revell[/caption]\r\n\r\n<span style="font-weight: 400;">Library of Babel Gala Dinner and Auction tickets include complimentary valet parking, entry to the Library of Babel Dinner and Auction featuring a bountiful dinner, a silent auction gallery and live auction, music and surprise wandering performances.</span>\r\n\r\n<span style="font-weight: 400;">Participation Steward Tables and Civic Responsibility Sustainer Tables</span> <span style="font-weight: 400;">include tickets for all eight guests to the official Artumnal Celebration held at The Great Northern on Friday, November 15. We expect the Library of Babel to sell out quickly, so please purchase your tickets soon!</span>\r\n\r\n<span style="font-weight: 400;">Unable to attend the event? </span>\r\n<div id="common-button">[bm_donation_system type=\'popup\' text=\'DONATE\']</div>', 'Tickets', '', 'publish', 'closed', 'closed', '', 'tickets', '', '', '2019-10-10 18:58:38', '2019-10-10 18:58:38', '', 0, 'http://localhost/artumnal/?page_id=7', 0, 'page', '', 0),
	(9, 3, '2018-09-10 20:39:37', '2018-09-10 20:39:37', '[caption id="attachment_209" align="aligncenter" width="516"]<img class=" wp-image-209" src="http://artumnal.burningman.org/wp-content/uploads/IMG_8007-300x240.jpg" alt="" width="516" height="412" /> Photo by Jane Hu[/caption]\r\n\r\n<span style="font-weight: 400;">The silent and live auctions are a highlight of this inspiring and creative annual event.</span>\r\n\r\n<span style="font-weight: 400;">The Artumnal Gathering silent and live auctions feature unique experiences, packages, and artworks from some of Burning Mans most creative participants.</span>\r\n\r\n[caption id="attachment_210" align="alignleft" width="142"]<img class=" wp-image-210" src="http://artumnal.burningman.org/wp-content/uploads/IMG_8009-200x300.jpg" alt="" width="142" height="213" /> Photo by Jane Hu[/caption]\r\n\r\n<span style="font-weight: 400;">Silent auction items will be available for online bidding prior to and during the event from anywhere in the world. Check back soon for more details about how you can support Burning Man Project and bid on marvelous once-in-a-lifetime experiences and imaginative works of art.</span>\r\n\r\n<span style="font-weight: 400;">Silent and live auction proceeds directly support Art and Civic Engagement programs that nurture a global spectrum of projects and partnerships inspired by the art and community of Black Rock City and beyond. Programs include Honoraria Art Grants providing $1.3M to projects coming to Black Rock City, Art Support Services to help artists install their pieces on playa, Civic Arts helping to place Burning Man art beyond the playa, Global Art Grants that foster participation and creativity through public projects around the world, the Regional Network, Burners Without Borders, and more</span><i><span style="font-weight: 400;">. </span></i><span style="font-weight: 400;">Last year we raised over $200,000 in the silent and live auctions to support Art and Civic Engagement.</span>\r\n\r\n[caption id="attachment_214" align="alignright" width="300"]<img class="size-medium wp-image-214" src="http://artumnal.burningman.org/wp-content/uploads/IMG_7954-300x200.jpg" alt="" width="300" height="200" /> Photo by Jane Hu[/caption]\r\n\r\n<span style="font-weight: 400;">If you are interested in donating to the Artumnal Gathering auction please <a href="artumnal@burningman.org">contact us</a> for more information. You can also reach us by phone at 415.865.3800 x 150.</span>', 'Auction', '', 'publish', 'closed', 'closed', '', 'auction', '', '', '2019-10-03 03:15:06', '2019-10-03 03:15:06', '', 0, 'http://localhost/artumnal/?page_id=9', 0, 'page', '', 0),
	(11, 3, '2018-09-10 20:39:44', '2018-09-10 20:39:44', 'Photos from the 2018 Artumnal Gathering Dinner &amp; Auction\r\n\r\n[gallery type="rectangular" ids="213,217,200,216,201,204,208,215,214,198,197,212,211,210,199,209,207,206,205,203,202"]\r\n\r\n&nbsp;\r\n\r\nPhotos from our 2017 event.\r\n\r\n[gallery type="rectangular" link="none" size="medium" ids="109,108,107,106,105,104,103,102,101,100,99,98,97,96,95,94,93,92,91,90,89,88,87,86,85,84,83,82" orderby="rand"]\r\n<div id="common-button">[bm_donation_system type=\'popup\' text=\'DONATE\']</div>', 'Photos', '', 'publish', 'closed', 'closed', '', 'photos', '', '', '2019-09-30 21:54:05', '2019-09-30 21:54:05', '', 0, 'http://localhost/artumnal/?page_id=11', 0, 'page', '', 0),
	(13, 3, '2018-09-10 20:39:54', '2018-09-10 20:39:54', '<h3><b>Event Proceeds</b></h3>\r\n<span style="font-weight: 400;">Artumnal Gathering proceeds directly support Art and Civic Engagement programs that nurture a global spectrum of projects and partnerships inspired by the art and community of Black Rock City and beyond. Programs include Honoraria Art Grants providing $1.3M to projects coming to Black Rock City, Art Support Services to help artists install their pieces on playa, Civic Arts helping to place Burning Man art beyond the playa, Global Art Grants that foster participation and creativity through public projects around the world, the Regional Network, Burners Without Borders, and more</span><i><span style="font-weight: 400;">.</span></i>\r\n\r\n<span style="font-weight: 400;">More information about these programs is available in our </span><a href="https://annualreport2018.burningman.org/" target="_blank" rel="noopener noreferrer"><span style="font-weight: 400;">2018 Annual Report</span></a><span style="font-weight: 400;">.</span>\r\n<h3><b>Contact Information</b></h3>\r\n<span style="font-weight: 400;">If you have any questions please direct all inquiries to </span><a href="mailto:artumnal@burningman.org"><span style="font-weight: 400;">artumnal@burningman.org</span></a><span style="font-weight: 400;">. If you are interested in volunteering please contact </span><a href="mailto:artumnalvolunteer@burningman.org"><span style="font-weight: 400;">artumnalvolunteer@burningman.org</span></a><span style="font-weight: 400;">.</span>\r\n<h3><strong>IS THERE A COAT CHECK ?</strong></h3>\r\n<span style="font-weight: 400;">Yes! There is a complimentary coat check at the venue.</span>\r\n<h3><b>DIRECTIONS &amp; PARKING</b></h3>\r\n<span style="font-weight: 400;">Complimentary valet parking is available for all guests.</span>\r\n\r\n<span style="font-weight: 400;">The venue is located in Downtown San Francisco at 511 Harrison Street. Parking can be a challenge and carpooling is encouraged. Lyft, Uber or taxis are also readily available options.</span>\r\n\r\n<span style="font-weight: 400;">Directions from the East Bay :\r\n</span><span style="font-weight: 400;">Take I-580 E/I-80 W towards San Francisco. Follow I-80 W towards San Francisco. Take exit 2B from I-80 W. Turn left on Harrison. Terra Gallery will be on the left.</span>\r\n\r\n<span style="font-weight: 400;">Directions from the North Bay:\r\n</span><span style="font-weight: 400;">Take US-101 S towards San Francisco. Turn left on Broadway to continue through the Robert C Levy Tunnel. Continue on Broadway and turn right on. Turn left onto Bush Street. Continue onto 1st and turn right on Harrison Street. The venue will be on the left.</span>\r\n\r\n<span style="font-weight: 400;">Directions from South Bay / SFO Airport:\r\n</span><span style="font-weight: 400;">Take US-101 N. Take exit 430A toward Downtown SF. Merge onto I-280 N. Use the right 2 lanes to take exit 57 for Sixth Street. Continue on 6th Street. Turn right onto Bryant. Turn left on 2nd. Turn right on Harrison. The venue will be on the left.</span>\r\n<h3><b>DO I HAVE TO INCLUDE NAMES OF MY TABLE GUESTS?</b></h3>\r\n<span style="font-weight: 400;">There is no rush to provide the names of your table guests. The Artumnal team will reach out to you in late October to receive a complete list.</span>', 'About', '', 'publish', 'closed', 'closed', '', 'about', '', '', '2019-10-07 19:46:57', '2019-10-07 19:46:57', '', 0, 'http://localhost/artumnal/?page_id=13', 0, 'page', '', 0),
	(15, 3, '2018-09-10 20:40:11', '2018-09-10 20:40:11', '<span style="font-weight: 400;">Are you interested in volunteering at the Library of Babel Artumnal Gathering Dinner and Auction? We need volunteers leading up to the event and on November 16th from 6:00 a.m. to 3:00 a.m. (November 17th). Were currently looking for volunteers to help in the roles below. If youre interested in volunteering please contact</span><span style="font-weight: 400;"><a href="mailto:artumnalvolunteer@burningman.org">artumnalvolunteer@burningman.org</a>. Thank you for supporting this event, it would not be possible without you.</span>\r\n\r\n[caption id="attachment_223" align="alignright" width="437"]<img class=" wp-image-223" src="http://artumnal.burningman.org/wp-content/uploads/IMG_8502-300x200.jpg" alt="" width="437" height="291" /> Photo by Jane Hu[/caption]\r\n<ul>\r\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">General Setup</span></li>\r\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Volunteer and Artist Check-in</span></li>\r\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Staff Hospitality</span></li>\r\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Silent &amp; Live Auction Support</span></li>\r\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Transportation Crew</span></li>\r\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Decor</span></li>\r\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Food serving</span></li>\r\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Coat Check</span></li>\r\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">General Strike and LNT ...and a number of other specific and general roles!</span></li>\r\n</ul>\r\n<span style="font-weight: 400;">If youve participated in previous years or have specialized experience for a role that interests you, let us know by emailing <a href="mailto:artumnalvolunteer@burningman.org">artumnalvolunteer@burningman.org</a>. Your input will help us find the right fit for your amazing talents. Thank you again for your support of this event.</span>\r\n\r\n&nbsp;', 'Volunteer', '', 'publish', 'closed', 'closed', '', 'volunteer', '', '', '2019-10-07 19:35:33', '2019-10-07 19:35:33', '', 0, 'http://localhost/artumnal/?page_id=15', 0, 'page', '', 0),
