	(196, 5, '2019-10-03 03:04:25', '2019-10-03 03:04:25', '<div class="gmail_default"><span style="font-weight: 400;">Show your commitment to Burning Man arts as a <a href="https://www.eventbrite.com/e/artumnal-gathering-dinner-auction-tickets-62960325027" target="_blank" rel="noopener noreferrer">table sponsor</a> reserve your tickets by October 16th to be listed on event materials.</span></div>\n<div class="gmail_default"></div>\n<div class="gmail_default"></div>\n<div class="fancy-box">\n<h2>Library of Babel Dinner and Auction: Terra Gallery, 511 Harrison Street, San Francisco</h2>\nSaturday, November 16, 2019 | 5:00 PM\n\n<a href="https://www.eventbrite.com/e/artumnal-gathering-dinner-auction-tickets-62960325027" target="_blank" rel="noopener noreferrer">Reserved Table for eight guests Gala Dinner &amp; Auction  $5,000-$25,000</a>\n\n<a href="https://www.eventbrite.com/e/artumnal-gathering-dinner-auction-tickets-62960325027" target="_blank" rel="noopener noreferrer">Individual Ticket Gala Dinner &amp; Auction  $625</a>\n<h2>Artumnal Gathering Celebration: <span style="font-weight: 400;">Great Northern, 119 Utah Street, San Francisco</span></h2>\n<span style="font-weight: 400;">Friday, November 15, 2019| Event details announced soon\n</span><span style="font-weight: 400;">Tickets: $40-$60 (available soon)</span>\n\n</div>\n\n[caption id="attachment_200" align="aligncenter" width="565"]<img class="wp-image-200" src="http://artumnal.burningman.org/wp-content/uploads/2018-Artumnal_044-1-300x200.jpg" alt="" width="565" height="376" /> Photo by Chuck Revell[/caption]\n\n<span style="font-weight: 400;">Library of Babel Gala Dinner and Auction tickets include complimentary valet parking, entry to the Library of Babel Dinner and Auction featuring a bountiful dinner, a silent auction gallery and live auction, music and surprise wandering performances.</span>\n\n<span style="font-weight: 400;">Participation Steward Tables and Civic Responsibility Sustainer Tables</span> <span style="font-weight: 400;">include tickets for all eight guests to the official Artumnal Celebration held at The Great Northern on Friday, November 15. We expect the Library of Babel to sell out quickly, so please purchase your tickets soon!</span>\n\n<span style="font-weight: 400;">Choose your Library of Babel table sponsorship level to support Burning Man Art and Civic Engagement:</span>\n<p style="text-align: center;"><em>Complimentary valet parking is available for all guests.</em></p>\n\n<div id="common-button">[bm_donation_system type=\'popup\' text=\'DONATE\']</div>', 'Tickets', '', 'inherit', 'closed', 'closed', '', '7-autosave-v1', '', '', '2019-10-03 03:04:25', '2019-10-03 03:04:25', '', 7, 'http://artumnal.burningman.org/7-autosave-v1/', 0, 'revision', '', 0),
	(218, 5, '2019-09-30 21:52:53', '2019-09-30 21:52:53', 'Photos from the 2018 Artumnal Gathering Dinner &amp; Auction\n\n&nbsp;\n\n&nbsp;\n\nPhotos from our 2017 event.\n\n[gallery type="rectangular" link="none" size="medium" ids="109,108,107,106,105,104,103,102,101,100,99,98,97,96,95,94,93,92,91,90,89,88,87,86,85,84,83,82" orderby="rand"]\n<div id="common-button">[bm_donation_system type=\'popup\' text=\'DONATE\']</div>', 'Photos', '', 'inherit', 'closed', 'closed', '', '11-autosave-v1', '', '', '2019-09-30 21:52:53', '2019-09-30 21:52:53', '', 11, 'http://artumnal.burningman.org/11-autosave-v1/', 0, 'revision', '', 0),
	(219, 5, '2019-10-07 19:34:26', '2019-10-07 19:34:26', '<span style="font-weight: 400;">Are you interested in volunteering at the Library of Babel Artumnal Gathering Dinner and Auction? We need volunteers leading up to the event and on November 16th from 6:00 a.m. to 3:00 a.m. (November 17th). Were currently looking for volunteers to help in the roles below. If youre interested in volunteering please contact</span><span style="font-weight: 400;"><a href="mailto:artumnalvolunteer@burningman.org">artumnalvolunteer@burningman.org</a>. Thank you for supporting this event, it would not be possible without you.</span>\n\n&nbsp;\n<ul>\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">General Setup</span></li>\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Volunteer and Artist Check-in</span></li>\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Staff Hospitality</span></li>\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Silent &amp; Live Auction Support</span></li>\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Transportation Crew</span></li>\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Decor</span></li>\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Food serving</span></li>\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">Coat Check</span></li>\n 	<li style="font-weight: 400;"><span style="font-weight: 400;">General Strike and LNT ...and a number of other specific and general roles!</span></li>\n</ul>\n<span style="font-weight: 400;">If youve participated in previous years or have specialized experience for a role that interests you, let us know by emailing <a href="mailto:artumnalvolunteer@burningman.org">artumnalvolunteer@burningman.org</a>. Your input will help us find the right fit for your amazing talents. Thank you again for your support of this event.</span>\n\n&nbsp;', 'Volunteer', '', 'inherit', 'closed', 'closed', '', '15-autosave-v1', '', '', '2019-10-07 19:34:26', '2019-10-07 19:34:26', '', 15, 'http://artumnal.burningman.org/15-autosave-v1/', 0, 'revision', '', 0),
	(221, 5, '2019-10-10 18:57:10', '2019-10-10 18:57:10', '<h1 style="text-align: center;">Library of Babel - Artumnal Gathering Dinner &amp; Auction</h1>\n<div class="gmail_default">\n<p style="text-align: center;"><span style="font-weight: 400;">Saturday, November 16, 2019 |</span><span style="font-weight: 400;">5:00pm - 12:30am\n</span><span style="font-weight: 400;">Terra Gallery, 511 Harrison Street, San Francisco\n</span><span style="font-weight: 400;">A fundraiser to benefit Burning Man\'s Art and Civic Engagement programs\n</span></p>\n<p style="text-align: center;"><a href="https://www.eventbrite.com/e/artumnal-gathering-dinner-auction-tickets-62960325027" target="_blank" rel="noopener noreferrer"><span style="font-weight: 400;">Reserved Table for eight guests Gala Dinner &amp; Auction - $5,000-$25,000</span></a>\n<a href="https://www.eventbrite.com/e/artumnal-gathering-dinner-auction-tickets-62960325027" target="_blank" rel="noopener noreferrer"><span style="font-weight: 400;">Individual Ticket Gala Dinner &amp; Auction - $625</span></a></p>\n\n<h1 style="text-align: center;">Artumnal Gathering Celebration</h1>\n<div class="gmail_default">\n<p style="text-align: center;"><span style="font-weight: 400;">Presented by Pink Mammoth</span></p>\n<p style="text-align: center;"><span style="font-weight: 400;">Friday, November 15, 2019\n</span><span style="font-weight: 400;">Great Northern, 119 Utah Street, San Francisco | 9:00pm-4:00am\n</span><span style="font-weight: 400;">A fundraiser to benefit Burning Man Project\'s Art and Civic Engagement programs\n</span><span style="font-weight: 400;">Tickets: $40-$60 (available soon)</span></p>\n<p style="text-align: center;"><span style="font-weight: 400;">You can purchase tickets to one or more of the festivities and we thank you for your generous support!</span></p>\n<p style="text-align: center;"><span style="font-weight: 400;">Announcement of participating creatives coming soon!</span></p>\n\n\n[caption id="attachment_213" align="aligncenter" width="300"]<img class="size-medium wp-image-213" src="http://artumnal.burningman.org/wp-content/uploads/IMG_8072-300x200.jpg" alt="" width="300" height="200" /> Photo by Jane Hu[/caption]\n<h1><b>Library of Babel</b></h1>\n<span style="font-weight: 400;">Burning Man Project cordially invites you to the Library of Babel Artumnal Gathering Dinner and Auction, an annual celebration of art, artists, makers, creators, and inspirational communities of the worldwide Burning Man culture.</span>\n\n<span style="font-weight: 400;">This year we welcome you to the Library of Babel, a short story that describes the worlds biggest library. It houses every book ever written, and that will be written. Stories have a protagonist, setting, some kind of plot, and an unexpected twist. Some have villains, accomplices, and heroes. Some haunt us, others inspire and entrance us, but there is no escaping the fact that stories shape how we think and experience the past, present, and future.</span>\n\n<span style="font-weight: 400;">Engage in an adventure of the imagination because for one evening, all books lead to one place: The Library of Babel. Come as a favorite character, the character you truly are, or someone entirely new. Join us in a living plot twist and shape the evenings narrative with your creative presence and participation. It will be a night where fairy tales, history, poetry and mythology co-exist, and where plots cross and twist like neural networks and overlapping commuter lines to strange destinations. It will be an evening where the normal rules of grammar and reality are made to blush and shatter. Let us add new stories to the infinite Library of Babel.</span>\n\n<span style="font-weight: 400;">If you are planning to theme your entire table for dinner, </span><a href="mailto:artumnal@burningman.org"><span style="font-weight: 400;">contact us</span></a><span style="font-weight: 400;"> to let us know!</span>\n<h1><b>Artumnal Gathering Celebration</b></h1>\n<span style="font-weight: 400;">Dance the night away Burning Man style on Friday, November 15, 2019! The Artumnal Gathering Celebration deserves its own night for revelers to connect, dream, and imagine in a spectacular setting. This experiential event will kick off a weekend devoted to Artumnal celebrations. More details coming soon.</span>\n<h1><b>Make it a Weekend</b></h1>\n<span style="font-weight: 400;">Consider making it a weekend to support Burning Man Projects Art and Civic Engagement programs by attending both events: the Artumnal Gathering Celebration on Friday, November 15, 2019 and the Library of Babel Dinner and Auction on November 16, 2019.</span>\n<h1><b>Your participation nurtures Burning Man Art and Civic Engagement and more</b></h1>\n<span style="font-weight: 400;">Artumnal Gathering weekend event proceeds directly support Burning Man Projects Art and Civic Engagement programs that nurture a global spectrum of projects and partnerships inspired by the art and community of Black Rock City and beyond. Programs include Honoraria Art Grants providing $1.3M to projects coming to Black Rock City, Art Support Services to help artists install their pieces on playa, Civic Arts helping to place Burning Man art beyond the playa, Global Art Grants that foster participation and creativity through public projects around the world, the Regional Network, Burners Without Borders, and more</span><i><span style="font-weight: 400;">.</span></i>\n\n<span style="font-weight: 400;">Your generosity will fuel the ongoing mission of Burning Man Project, a nonprofit organization that believes in a world of creativity, participation, and Radical Self-expression. Every day we provide support for the Regional Network, artists, volunteers, and our community across the globe because we know the transformative experiences that happen in Black Rock City are inspiring a world of change.</span>\n<p style="text-align: center;"><b>* * *</b></p>\n<p style="text-align: center;"><i style="font-size: 1.1rem;">Burning Man is the only place in the world where I have found a space in which I can express myself and, at the same time, learn as an artist and as a person." -</i><i style="font-size: 1.1rem;"> Black Rock City Arts Honoraria Recipient</i></p>\n<p style="text-align: center;"></p>\n\n</div>\n</div>', 'Event Info', '', 'inherit', 'closed', 'closed', '', '41-autosave-v1', '', '', '2019-10-10 18:57:10', '2019-10-10 18:57:10', '', 41, 'http://artumnal.burningman.org/41-autosave-v1/', 0, 'revision', '', 0),
	(222, 5, '2019-10-03 03:14:56', '2019-10-03 03:14:56', '[caption id="attachment_209" align="aligncenter" width="516"]<img class=" wp-image-209" src="http://artumnal.burningman.org/wp-content/uploads/IMG_8007-300x240.jpg" alt="" width="516" height="412" /> Photo by Jane Hu[/caption]\n\n<span style="font-weight: 400;">The silent and live auctions are a highlight of this inspiring and creative annual event.</span>\n\n<span style="font-weight: 400;">The Artumnal Gathering silent and live auctions feature unique experiences, packages, and artworks from some of Burning Mans most creative participants.</span>\n\n[caption id="attachment_210" align="alignleft" width="200"]<img class="size-medium wp-image-210" src="http://artumnal.burningman.org/wp-content/uploads/IMG_8009-200x300.jpg" alt="" width="200" height="300" /> Photo by Jane Hu[/caption]\n\n<span style="font-weight: 400;">Silent auction items will be available for online bidding prior to and during the event from anywhere in the world. Check back soon for more details about how you can support Burning Man Project and bid on marvelous once-in-a-lifetime experiences and imaginative works of art.</span>\n\n<span style="font-weight: 400;">Silent and live auction proceeds directly support Art and Civic Engagement programs that nurture a global spectrum of projects and partnerships inspired by the art and community of Black Rock City and beyond. Programs include Honoraria Art Grants providing $1.3M to projects coming to Black Rock City, Art Support Services to help artists install their pieces on playa, Civic Arts helping to place Burning Man art beyond the playa, Global Art Grants that foster participation and creativity through public projects around the world, the Regional Network, Burners Without Borders, and more</span><i><span style="font-weight: 400;">. </span></i><span style="font-weight: 400;">Last year we raised over $200,000 in the silent and live auctions to support Art and Civic Engagement.</span>\n\n[caption id="attachment_214" align="alignright" width="300"]<img class="size-medium wp-image-214" src="http://artumnal.burningman.org/wp-content/uploads/IMG_7954-300x200.jpg" alt="" width="300" height="200" /> Photo by Jane Hu[/caption]\n\n<span style="font-weight: 400;">If you are interested in donating to the Artumnal Gathering auction please <a href="artumnal@burningman.org">contact us</a> for more information. You can also reach us by phone at 415.865.3800 x 150.</span>', 'Auction', '', 'inherit', 'closed', 'closed', '', '9-autosave-v1', '', '', '2019-10-03 03:14:56', '2019-10-03 03:14:56', '', 9, 'http://artumnal.burningman.org/9-autosave-v1/', 0, 'revision', '', 0),
	(224, 5, '2019-10-07 19:44:20', '2019-10-07 19:44:20', '<h3><b>Event Proceeds</b></h3>\n<span style="font-weight: 400;">Artumnal Gathering proceeds directly support Art and Civic Engagement programs that nurture a global spectrum of projects and partnerships inspired by the art and community of Black Rock City and beyond. Programs include Honoraria Art Grants providing $1.3M to projects coming to Black Rock City, Art Support Services to help artists install their pieces on playa, Civic Arts helping to place Burning Man art beyond the playa, Global Art Grants that foster participation and creativity through public projects around the world, the Regional Network, Burners Without Borders, and more</span><i><span style="font-weight: 400;">.</span></i>\n\n<span style="font-weight: 400;">More information about these programs is available in our </span><a href="https://annualreport2018.burningman.org/" target="_blank" rel="noopener noreferrer"><span style="font-weight: 400;">2018 Annual Report</span></a><span style="font-weight: 400;">.</span>\n<h3><b>Contact Information</b></h3>\n<span style="font-weight: 400;">If you have any questions please direct all inquiries to </span><a href="mailto:artumnal@burningman.org"><span style="font-weight: 400;">artumnal@burningman.org</span></a><span style="font-weight: 400;">. If you are interested in volunteering please contact </span><a href="mailto:artumnalvolunteer@burningman.org"><span style="font-weight: 400;">artumnalvolunteer@burningman.org</span></a><span style="font-weight: 400;">.</span>\n<h3><strong>IS THERE A COAT CHECK ?</strong></h3>\n<span style="font-weight: 400;">Yes! There is a complimentary coat check at the venue.</span>\n<h3><b>DIRECTIONS &amp; PARKING</b></h3>\n<span style="font-weight: 400;">Complimentary valet parking is available for all guests.</span>\n\n<span style="font-weight: 400;">The venue is located in Downtown San Francisco at 511 Harrison Street. Parking can be a challenge and carpooling is encouraged. Lyft, Uber or taxis are also readily available options.</span>\n\n<span style="font-weight: 400;">Directions from the East Bay :\n</span><span style="font-weight: 400;">Take I-580 E/I-80 W towards San Francisco. Follow I-80 W towards San Francisco. Take exit 2B from I-80 W. Turn left on Harrison. Terra Gallery will be on the left.</span>\n\n<span style="font-weight: 400;">Directions from the North Bay:\n</span><span style="font-weight: 400;">Take US-101 S towards San Francisco. Turn left on Broadway to continue through the Robert C Levy Tunnel. Continue on Broadway and turn right on. Turn left onto Bush Street. Continue onto 1st and turn right on Harrison Street. The venue will be on the left.</span>\n\n<span style="font-weight: 400;">Directions from South Bay / SFO Airport:\n</span><span style="font-weight: 400;">Take US-101 N. Take exit 430A toward Downtown SF. Merge onto I-280 N. Use the right 2 lanes to take exit 57 for Sixth Street. Continue on 6th Street. Turn right onto Bryant. Turn left on 2nd. Turn right on Harrison. The venue will be on the left.</span>\n<h3><b>DO I HAVE TO INCLUDE NAMES OF MY TABLE GUESTS?</b></h3>\n<span style="font-weight: 400;">There is no rush to provide the names of your table guests. The Artumnal team will reach out to you in late October to receive a complete list.</span>', 'About', '', 'inherit', 'closed', 'closed', '', '13-autosave-v1', '', '', '2019-10-07 19:44:20', '2019-10-07 19:44:20', '', 13, 'http://artumnal.burningman.org/13-autosave-v1/', 0, 'revision', '', 0),
